import React from 'react';
import AnchorLink from 'react-anchor-link-smooth-scroll';


export default function Home(props) {
    const upArrow = <img 
        src={require('../assets/arrow-alt-circle-up-solid.svg')} 
        alt='Up arrow' 
        width='50px' />;

    const downArrow = <img 
        src={require('../assets/arrow-alt-circle-down-solid.svg')} 
        alt='Down arrow' 
        width='50px' />;

    const homeIcon = <img 
        src={require('../assets/home-solid.svg')} 
        alt='Home icon' 
        width='50px' />;

    const style = {
        background: `url(${require('../assets/coding.png')}) no-repeat center center fixed`,
        WebkitBackgroundSize: 'cover',
        MozBackgroundSize: 'cover',
        OBackgroundSize: 'cover',
        backgroundSize: 'cover',
    }

    return(
        <section className='container-fluid p-3' id='home' style={style}>
            <AnchorLink className='btn btn-light' href='#navbar'>{homeIcon}</AnchorLink>
                <AnchorLink className='btn btn-light' href='#home'>{upArrow}</AnchorLink>
            <div className='container-md appSection mx-3-auto mt-5'>
                HOME
                <br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br />
            </div>
            <div className='text-right'>
                <AnchorLink className='btn btn-light' href='#skills'>{downArrow}</AnchorLink>
            </div>
        </section>
    )
}
